        const [count,setCount]=useState(0);
          const handle_event=()=>{
            
            
            setCount((prevCount)=>{
                return prevCount+1;
            });
         }
        return (
            <>
         <h1>No of times you've clicked : {count}</h1>
         <button class="c" onClick={handle_event}>click me</button>


        </>
        )
    }



export default Practice
